import React, { Component } from 'react';


class BottomNavRight extends Component {

    render() {
        return (
            <div className="col-lg-6 col-md-6 col-sm-12 col-xs-12 attr-nav">
                <ul className="bottom-nav-list-inline2">
                    <li><a href="know-more.html" class="nav-link-hover">اعرف اكتر</a></li>
                    <li><a href="latest-news.html" class="nav-link-hover">اخر الاخبار</a></li>
                    <li><a href="showroom.html" class="nav-link-hover">العروض</a></li>
                    <li class="dropdown"><a href="#" class="nav-link dropdown-toggle arrow nav-link-hover" data-toggle="dropdown">المركبات</a>
                    <ul class="dropdown-menu">
                        <li class="drobmenu-li"><a href="new-cars.html">سيارات جديده</a></li>
                        <li class="drobmenu-li"><a href="used-cars.html">سيارات مستعمله</a></li>
                        <li class="drobmenu-li"><a href="motors.html">موتوسيكلات</a></li>
                        <li class="drobmenu-li-noborder"><a href="boats.html">قوارب</a></li>
                    </ul></li>
                    <li><a href="home.html" class="active nav-link-hover">الرائيسية</a></li>
                    <li class="search"><a href="#" class="nav-link-hover"><i class="fa fa-search"></i></a></li>
                </ul>
        </div>
        );
    }
}
